import React, { useState } from "react";
import { Box, Button, Typography, Card, CardContent } from "@mui/material";

const QuizSection = () => {
  const [selectedAnswer, setSelectedAnswer] = useState(null);
  const [showAnswer, setShowAnswer] = useState(false);

  const handleAnswer = (answer) => {
    setSelectedAnswer(answer);
    setShowAnswer(true);
  };

  return (
    <Box
      sx={{
        padding: "40px 20px",
        backgroundColor: "#121212",
        textAlign: "center",
      }}
    >
      <Typography
        variant="h2"
        sx={{
          color: "#FFD60A",
          fontFamily: "Georgia, serif",
          fontWeight: "bold",
          marginBottom: "20px",
          letterSpacing: "1px",
        }}
      >
        Викторина о спортивных достижениях Кыргызстана
      </Typography>

      <Card
        sx={{
          maxWidth: "600px",
          margin: "0 auto",
          backgroundColor: "#1e1e1e",
          borderRadius: "12px",
          boxShadow: "0 4px 10px rgba(255, 255, 255, 0.1)",
        }}
      >
        <CardContent>
          <Typography
            variant="h6"
            sx={{
              fontSize: "20px",
              color: "white",
              marginBottom: "20px",
            }}
          >
            Кто из спортсменов Кыргызстана стал бронзовым призером на
            Олимпийских играх 2024 года в борьбе?
          </Typography>
          <Button
            variant="outlined"
            onClick={() => handleAnswer("Акжол Махмудов")}
            sx={{
              marginBottom: "10px",
              width: "100%",
              backgroundColor: "#ff4d6d",
              color: "white",
              "&:hover": {
                backgroundColor: "#ff3366",
              },
            }}
          >
            Акжол Махмудов
          </Button>
          <Button
            variant="outlined"
            onClick={() => handleAnswer("Айсулуу Тыныбекова")}
            sx={{
              marginBottom: "10px",
              width: "100%",
              backgroundColor: "#ff4d6d",
              color: "white",
              "&:hover": {
                backgroundColor: "#ff3366",
              },
            }}
          >
            Айсулуу Тыныбекова
          </Button>
          <Button
            variant="outlined"
            onClick={() => handleAnswer("Мунарбек Сейитбек уулу")}
            sx={{
              marginBottom: "10px",
              width: "100%",
              backgroundColor: "#ff4d6d",
              color: "white",
              "&:hover": {
                backgroundColor: "#ff3366",
              },
            }}
          >
            Мунарбек Сейитбек уулу
          </Button>

          {showAnswer && (
            <Box sx={{ marginTop: "20px" }}>
              <Typography
                variant="h6"
                sx={{
                  fontSize: "18px",
                  color: selectedAnswer === "Акжол Махмудов" ? "green" : "red",
                  fontWeight: "bold",
                }}
              >
                {selectedAnswer === "Акжол Махмудов"
                  ? "Правильно! Акжол Махмудов завоевал бронзу."
                  : "Неверно. Попробуйте снова!"}
              </Typography>
            </Box>
          )}
        </CardContent>
      </Card>
    </Box>
  );
};

const MainPage = () => {
  return (
    <Box sx={{ minHeight: "100vh", backgroundColor: "#121212" }}>
      {/* Контент главной страницы */}
      <Box sx={{ padding: "20px", color: "white", textAlign: "center" }}>
        <Typography variant="h1" sx={{ fontSize: "48px", fontWeight: "bold" }}>
          Спортивные достижения Кыргызстана на Олимпийских играх в Париже 2024
          года
        </Typography>
        {/* Текст достижения и спортсмены... */}
        {/* Фото и другие блоки */}
      </Box>

      {/* Викторина */}
      <QuizSection />
    </Box>
  );
};

export default MainPage;

